@Test
    public void tryToGetInstanceWithNullIncludes() {
        assertThatNullPointerException()
                .isThrownBy(() -> ImmutableFilteredAcknowledgementRequest.getInstance(null, null))
                .withMessage("The includes must not be null!")
                .withNoCause();
    }

